import React from 'react';
import './Navbar.css';

export default function Navbar() {
  return (
    <div>
      <nav>
        <ul className="list">
          <li>
            <button type="button" className="accueil">
              {' '}
              <span className="icon-home"> Acc </span>{' '}
            </button>
          </li>
          <li>
            <button type="button" className="quizzMood">
              {' '}
              <span className="icon-logo"> Quizz </span>
            </button>
          </li>
        </ul>
      </nav>
    </div>
  );
}
